import React from "react";
import { Switch, BrowserRouter, Route } from "react-router-dom";

import CourseMain from "../CourseLanding/CourseMain";
import Account from "../UserLanding/CourseMain";
import NotFoundPage from "./NotFoundPage";

const routes = (

    <Switch>
      <Route path="/" component={CourseMain} exact={true} />
      <Route path="/user" component={Account} exact={true} />
      <Route component={NotFoundPage} />
    </Switch>

);

export default function BodyArea() {
  return routes;
}
